class TestRun{constructor(testRunId){this.testRunId=testRunId,this.createdTime=new Date}}class Tag{constructor(name,value){this.name=name,this.value=value,this.tagString=name+":"+value}}class User{constructor(userId,username,email,image){this.userId=userId,this.username=username,this.email=email,this.image=image}}class Provider{constructor(providerId,metadata){this.providerId=providerId,this.metadata=metadata}}class ProviderAccount{constructor(userId,providerId,accountId){this.userId=userId,this.providerId=providerId,this.accountId=accountId}}module.exports={TestRun:TestRun,Tag:Tag,User:User,Provider:Provider,ProviderAccount:ProviderAccount};